import React, { Component } from 'react';
import './MiFavorytes.css'

class MyFavorytes extends Component {
    constructor(props){
      super(props);
    }
        render() {
            return (

                <div>
                    <h3 className="divh">Mis tiendas favoritas</h3>
                  {this.props.name}
                </div>
            )
        }
}
export default MyFavorytes;
